import React from "react";

export const LoginForm = ({ 
    username,
    setUsername,
    password,
    setPassword,
    handleSubmit,
    handleLogin, 
    handlePasswordClick, 
    handleUsernameClick,
    usernamePlaceholder,
    passwordPlaceholder,
    addUser,
    handleUsernameBlur,
    handlePasswordBlur,
    handleInputClick
}) => {
    return (
        <form onSubmit={handleSubmit}>

            <h1 class="thin space">Sign In</h1>

            <h2 class='thin gap'>to continue to Gmail</h2>

            <label class="space">
                <input 
                    class="input"
                    type='text' 
                    value={username} 
                    onChange={(e) => setUsername(e.target.value)} 
                    placeholder={usernamePlaceholder}
                    onClick={handleInputClick}
                    onFocus={handleUsernameClick}
                    onBlur={handleUsernameBlur}
                />
            </label>
    
            <label class="space">
                <input 
                    class="input"
                    type='password'
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    placeholder={passwordPlaceholder}
                    onClick={handleInputClick}
                    onFocus={handlePasswordClick}
                    onBlur={handlePasswordBlur}
                />
            </label>
            
            <button class="space">LOGIN</button>


            <p class="space">Forgot Username?</p>
            <p class="space">Forgot Password?</p>
            <p class="last">Create account</p>
        </form>
  );
}
